ents:</strong> {{ webform_submission_value_14 }}<br>{% elseif 'recruiting' in webform_submission_value_3|render|lower %}<strong>Students:</strong> Recruiting<br>{% endif %}\r\n{% if 'recruiting' in webform_submission_value_3|render|lower %}\r\n{% if webform_submission_value_22 %}<strong>Student Skill Level Required: </strong> {{ webform_submission_value_22 }} {% endif %}\r\n{% if webform_submission_value_23 %}<strong>Student Profile: </strong> {{ webform_submission_value_23 }} {% endif %}\r\n{% endif %}\r\n{% if link_flag and 'recruiting' in webform_submission_value_3|render|lower %}<div class=\"my-2\">{{ link_flag }}</div>{% endif %}\r\n</div>\r\n</div>\r\n<div class=\"card my-3\">\r\n<div class=\"card-body\">\r\n<h3>Project Description</h3>\r\n{{ webform_submission_value_4 }}\r\n</div>\r\n</div>\r\n{% if (webform_submission_value_16 or webform_submission_value_17 or webform_submission_value_18) %}\r\n<div class=\"card my-3\">\r\n<div class=\"card-body\">\r\n<h3>Additional Resources</h3>\r\n{% if webform_submission_value_16 %}<strong>Github Contributions:</strong> {{ webform_submission_value_16 }}<br>{% endif %}\r\n{% if webform_submission_value_17 %}<strong>Launch Presentation:</strong> {{ webform_submission_value_17 }}<br>{% endif %}\r\n{% if webform_submission_value_21 %}<strong>Wrap Presentation:</strong> {{ webform_submission_value_21 }}<br>{% endif %}\r\n</div>\r\n</div>\r\n{% endif %}"
